import React, { Component } from 'react';
import './style.css';

class TodoListContainer extends Component {
  render() {
    return (
      <div>
        <ul>
          {/*this.props.TodoList.todos.map(todo => <Todo key={todo.id} data={todo}/>)*/}
          {console.log(this.props.TodoList)}
        </ul>
      </div>
    );
  }
}

export default TodoListContainer;
